import React from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Navbar() {
  const navigate = useNavigate();
  const isAdmin = localStorage.getItem("isAdmin") === "true";

  const handleLogout = () => {
    localStorage.removeItem("isAdmin");
    navigate("/admin-login");
  };

  return (
    <nav className="bg-blue-600 text-white px-6 py-4 shadow-md">
      <div className="max-w-7xl mx-auto flex justify-between items-center">
        {/* Left: Logo */}
        <div className="text-2xl font-bold tracking-wide">JantaVoice</div>

        {/* Right: Links */}
        <div className="flex space-x-6 w-1/2 justify-end items-center text-sm sm:text-base">
          <Link to="/" className="hover:text-yellow-200 transition">Home</Link>
          <Link to="/complaint" className="hover:text-yellow-200 transition">ComplaintForm</Link>
          <Link to="/voice" className="hover:text-yellow-200 transition">VoiceComplaint</Link>
          <Link to="/track" className="hover:text-yellow-200 transition">TrackStatus</Link>
          <Link to="/analytics" className="hover:text-yellow-200 transition">Analytics</Link>
          <Link to="/admin" className="hover:text-yellow-200 transition">AdminDashboard</Link>

          {isAdmin && (
            <button
              onClick={handleLogout}
              className="bg-red-500 hover:bg-red-600 px-3 py-1 rounded text-white text-xs sm:text-sm"
            >
              Logout
            </button>
          )}
        </div>
      </div>
    </nav>
  );
}
